import {useState} from 'react'

const Square = ({ value }) => {
    const [squareValue, setSquareValue] = useState(null);

    const handleClick = () => {
        setSquareValue('X')
    }
    return (<button className="square" onClick={handleClick}>{squareValue}</button>);
}

export default Square;
